prompt Creating GYM...
create table GYM
(
  address    VARCHAR2(50) not null,
  schedule   VARCHAR2(50) not null,
  gym_number NUMBER(5) not null,
  gym_name   VARCHAR2(50) not null
)
;
alter table GYM
  add primary key (GYM_NUMBER)
;

prompt Creating HALL...
create table HALL
(
  capacity    NUMBER(5) not null,
  schedule    VARCHAR2(50),
  hall_number NUMBER(5) not null,
  gym_number  NUMBER(5) not null
)
;
alter table HALL
  add primary key (HALL_NUMBER, GYM_NUMBER)
;
alter table HALL
  add foreign key (GYM_NUMBER)
  references GYM (GYM_NUMBER);

prompt Creating DEVICE...
create table DEVICE
(
  device_model  VARCHAR2(50) not null,
  device_number NUMBER(10) not null,
  instructions  VARCHAR2(50) not null,
  hall_number   NUMBER(5) not null,
  gym_number    NUMBER(5) not null
)
;
alter table DEVICE
  add primary key (DEVICE_NUMBER)
;
alter table DEVICE
  add foreign key (HALL_NUMBER, GYM_NUMBER)
  references HALL (HALL_NUMBER, GYM_NUMBER);

prompt Creating GYM_CLASS...
create table GYM_CLASS
(
  classid   INTEGER not null,
  classname VARCHAR2(50) not null,
  minage    INTEGER,
  maxage    INTEGER,
  duration  INTEGER,
  capacity  NUMBER(5)
)
;
alter table GYM_CLASS
  add primary key (CLASSID)
;
alter table GYM_CLASS
  add constraint CHK_AGE_RANGE
  check (MinAge < MaxAge);

prompt Creating GYM_CLASS_MEDICAL_CONSTRAINS...
create table GYM_CLASS_MEDICAL_CONSTRAINS
(
  medical_constrains VARCHAR2(50) not null,
  classid            INTEGER not null
)
;
alter table GYM_CLASS_MEDICAL_CONSTRAINS
  add primary key (MEDICAL_CONSTRAINS, CLASSID)
;
alter table GYM_CLASS_MEDICAL_CONSTRAINS
  add foreign key (CLASSID)
  references GYM_CLASS (CLASSID);

prompt Creating PERSON...
create table PERSON
(
  personid   INTEGER not null,
  birth_date DATE,
  first_name VARCHAR2(20),
  last_name  VARCHAR2(30),
  city       VARCHAR2(30) default 'Unknown',
  street     VARCHAR2(50),
  house_num  INTEGER,
  email      VARCHAR2(40) not null,
  gender     VARCHAR2(1) not null
)
;
alter table PERSON
  add primary key (PERSONID)
;

prompt Creating GYM_MEMBER...
create table GYM_MEMBER
(
  joindate        DATE not null,
  leavedate       DATE,
  personid        INTEGER not null,
  payment_details VARCHAR2(50),
  age             NUMBER(5),
  subscription    VARCHAR2(50),
  training_plan   VARCHAR2(50)
)
;
alter table GYM_MEMBER
  add primary key (PERSONID)
;
alter table GYM_MEMBER
  add constraint F_K_PERSON_ID foreign key (PERSONID)
  references PERSON (PERSONID);

prompt Creating GYM_MEMBER_MEDICAL_CONSTRAINS...
create table GYM_MEMBER_MEDICAL_CONSTRAINS
(
  medicalconstrains VARCHAR2(50) not null,
  personid          INTEGER not null
)
;
alter table GYM_MEMBER_MEDICAL_CONSTRAINS
  add primary key (MEDICALCONSTRAINS, PERSONID)
 ;
alter table GYM_MEMBER_MEDICAL_CONSTRAINS
  add foreign key (PERSONID)
  references GYM_MEMBER (PERSONID) on delete cascade;

prompt Creating TRAINER...
create table TRAINER
(
  license    VARCHAR2(20),
  experience FLOAT not null,
  personid   INTEGER not null,
  speciality VARCHAR2(50),
  salary     NUMBER(15)
)
;
alter table TRAINER
  add primary key (PERSONID)
;
alter table TRAINER
  add constraint F_K_TPERSON_ID foreign key (PERSONID)
  references PERSON (PERSONID);

prompt Creating LESSON...
create table LESSON
(
  start_date DATE not null,
  lessonid   INTEGER not null,
  rating     FLOAT,
  classid    INTEGER not null,
  roomnum    INTEGER not null,
  personid   INTEGER not null,
  gym_number NUMBER(5)
)
;
alter table LESSON
  add primary key (LESSONID, CLASSID)
;
alter table LESSON
  add constraint F_K_HALL foreign key (ROOMNUM, GYM_NUMBER)
  references HALL (HALL_NUMBER, GYM_NUMBER);
alter table LESSON
  add foreign key (CLASSID)
  references GYM_CLASS (CLASSID);
alter table LESSON
  add foreign key (PERSONID)
  references TRAINER (PERSONID) on delete cascade;

prompt Creating PERSON_PHONE...
